INSERT INTO `tblNews` (`id`, `date`, `colored`, `name`, `text`, `userid`, `deleted`) VALUES 
(1, '2004-05-20 14:11:10', 1, 'Техническая учёба.', 'Служба СЭПАК напоминает, что очередное занятие по техучёбе состоится сегодня в 16-00. Лекцию на тему "Использование EMail и Internet" прочитает Курылёв Алексей Владимирович.', 9, 1),
(2, '2004-05-20 15:25:15', 0, 'Алексей Курылев в данный момент зашел на сайт !!! ', 'Вот сейчас он читает эту самую новость !!!', 3, 1),
(13, '2004-10-25 16:11:58', 1, 'Результат проверки готовности Мордовского РДУ – филиала ОАО «СО-ЦДУ ЕЭС»\r\nк работе в осенне-зимний период 2004/2005 г.г.\r\n', 'Акт готовности и акт предписание в разделе - "Документы и приказы Мордовского РДУ" подраздел "Организационно-распорядительные документы"  ', 9, 1),
(5, '2004-05-24 08:53:53', 0, 'Сегодня День рождения Андрея Александровича Игнатьева!!!', 'В 12 часов ...', 3, 1),
(6, '2004-05-25 08:25:04', 0, 'Сегодня День рождения Ольги Ивановны Беркетовой!!!', 'На ТЭЦ ...', 3, 1),
(7, '2004-05-25 18:52:46', 1, 'Дружеская вечеринка', '', 3, 1),
(8, '2004-05-26 08:04:44', 0, '27 Мая День рождения Юрия Савельевича Илюшкина', '', 3, 1),
(9, '2004-05-26 08:04:26', 0, '27 Мая День рождения Александра Николаевича Романова', '', 3, 1),
(10, '2004-05-28 13:16:26', 0, '29 Мая День рождения Сергея Александровича Хлопунова', '', 3, 1),
(11, '2004-05-28 13:16:35', 0, 'Сегодня День рождения Вячеслава Николаевича Андрейкина', 'Поздравляем !!!', 3, 1),
(12, '2004-05-28 13:16:01', 0, '31 Мая День рождения Натальи Владимировны Матвеевой', '', 3, 1),
(14, '2005-03-30 11:43:41', 1, '', 'В разделе "Материалы балансирующего рынка" добавлен проектный документ по запуску конкурентного балансирующего рынка "Концепция программного обеспечения пускового комплекса БР"', 13, 1),
(15, '2005-04-01 08:04:05', 1, 'Поздравляем Курылева Алексея с Рождением Сына!!!', '', 1, 1),
(16, '2005-04-01 08:12:25', 0, 'Поздравляем Курылева Алексея с Рождением Сына!!!', 'Верим верим, но про первое апреля не забываем.', 1, 1),
(17, '2005-04-01 16:08:52', 0, 'Уважаемые работники РДУ!', 'Обращаю Ваше внимание на то, что образцы документов, необходимых для оформления загранпаспорта размещены в разделе "Документы иприказы Мордовского РДУ -"Положения и инструкции Мордовского РДУ"- Информация от АПО', 26, 1),
(18, '2005-05-06 15:39:34', 0, 'Замена почтового сервера на Microsoft Exchange Server 2003.', '7 мая 2005г произведена замена почтового сервера. Введен в эксплуатацию Microsoft Exchange Server 2003. Вся работа с почтой будет осуществляться с помощью почтового клиента Microsoft Office Outlook 2003. Со всеми вопросами обращаться в службу СЭПАК.', 1, 0),
(19, '2005-06-03 16:31:58', 0, 'Вышла в свет книга, посвященная ОДУ Средней Волги.', 'Вышла в свет книга, посвященная ОДУ Средней Волги. Желающие могут ознакомиться с ней <a href="download\\bookodu.pdf">(книга)</a>.', 1, 0),
(20, '2005-10-30 15:59:12', 1, 'ОДУ Средней Волги 45 лет.', 'Фильм 45 летия ОДУ Средней Волги <a href="file:\\\\rdusps\\CDU\\ODU.avi">(смотреть)</a>. Перед просмотром, сохраните фильм себе на диск.', 1, 0),
(21, '2005-11-30 15:59:12', 0, 'Внедрение Microsoft SharePoint Portal Server.', '1 декабря 2005г введен в эксплуатацию Microsoft SharePoint Portal Server 2003. Хранение и работа с документами будет осуществляться с помощью этого сервера. Со всеми вопросами обращаться в службу СЭПАК. \r\n', 1, 1),
(22, '2006-05-10 10:58:57', 0, 'Фильм-презентация ЦДУ', 'Фильм-презентация ЦДУ находится по <a href="\\\\rdusps\\CDU\\ЦДУ\\VIDEO_TS\\VIDEO_TS.IFO">этой</a> ссылке.', 1, 0),
(23, '2006-05-10 10:59:54', 0, 'Гимн системного оператора', 'Гимн системного оператора находится по <a href="\\\\rdusps\\CDU\\Гимн СО-ЦДУ ЕЭС Пик нагрузки.mp3">этой</a> ссылке.', 1, 0),
(24, '2006-05-15 12:01:49', 0, 'Видео с празднования Дня Энергетика 2005', 'Видео с празднования дня энергетика 2005 находится по <a href="\\\\rdusps\\CDU\\День энергетика 2005\\VIDEO_TS\\VIDEO_TS.IFO">этой</a> ссылке (в появившемся диалоговом окне нажмите ОТКРЫТЬ, и немного подождите, т.к. файлы очень большие).', 1, 0),
