(46, '2005-04-06 08:34:16', 0, 'С целью максимального информационного обеспечения процессов подготовки к запуску конкурентного балансирующего рынка электроэнергии, на внутреннем интернет-сайте ОДУ Средней Волги открыта страница, содержащая документы и информационные материалы, используемые для выполнения этой задачи. Ссылка на эту страницу находится в блоке ссылок и называется <b>Балансирующий рынок ОДУ СВ (внутренний)</b>. Пометка <b>внутренний</b> означает что при посещении данного сайта индивидуальный интернет-трафик не увеличивается.', 1, 7, 0),
(47, '2005-04-18 08:38:15', 1, '    В связи с вводом в эксплуатацию новой АТС Саранских электрических сетей изменилась нумерация абонентов. Для выхода на абонентов Саранских электрических сетей вместо номера \r\n3-ХХ  следует  набирать 31-ХХ, и вместо 5-ХХ набирать 32-ХХ. Набор возможен как с кодом 521, так и без кода выхода .', 1, 7, 0),
