(55, '2005-12-20 10:29:49', 0, 'Уважаемые абоненты!\r\nС 1 декабря 2005 г. изменяются телефонные коды городов России, начинающиеся с нуля - вместо "0" теперь необходимо набирать "4". Например, код Москвы "095" изменяется на "495". При этом следует руководствоваться следующими <a href="download/newnom.doc" class="desktop_text_a">правилами</a>.', 1, 3, 0),
