(62, '2006-03-22 11:06:53', 1, 'Уважаемые сотрудники Мордовского РДУ, по <a href="\\\\rdusps\\CDU\\VIDEO_TS\\VIDEO_TS.IFO">этой</a> ссылке находится фильм-презентация ЦДУ,   а по <a href="\\\\rdusps\\CDU\\Гимн СО-ЦДУ ЕЭС Пик нагрузки.mp3">этой</a> гимн Системного Оператора.\r\n(Если фильм не проигрывается обратитесь к сотрудникам СЭПАК).', 1, 30, 0),
(63, '2006-04-11 09:20:38', 0, 'Документы с заседания Координационного Энергетического Совета ОЭС Средней Волги находятся в разделе "Документы и приказы Мордовского РДУ" <a href="http://172.23.84.69/documents.php?dir=/Заседание%20Координационного%20Энергетического%20Совета%20ОЭС%20СВ">(ссылка).</a>', 1, 5, 0),
