(66, '2006-06-02 11:07:42', 1, '    Уважаемые работники служб и отделов, переведенных на КФОСТ!\r\nПрошу Вас ознакомиться и в дальнейшем при расчете  приработка руководствоваться  Инструкцией по расчету коллективного приработка подразделений, переведенных на КФОСТ, утвержденной директором Мордовского РДУ 15.05.2006 г. Документ размещен в меню "Документы и приказы Мордовского РДУ", "Положения и инструкции Мордовского РДУ" в папке "КФОСТ"\r\n', 26, 10, 0),
