(71, '2006-09-04 09:04:21', 0, '     Уважаемые абоненты!\r\n     Доводим до Вашего сведения, что 12 сентября 2006 г. с 10ч.30 мин. до 14ч. 00мин. будет ограничена местная телефонная связь в отделах и службах РДУ, расположенных по адресу: Александровское шоссе,13 в связи с проведением работ по конверсии АТС Hicom 300H. В каждом кабинете будет оставлено по одному местному номеру, на который будут переадресованы входящие вызовы с других номеров соответствующего отдела или службы. В этот период так же будет отсутствовать исходящая городская связь через «9» и входящая городская связь на номера 2957хх во всех отделах и службах Мордовского РДУ.\r\n     Ниже приводится перечень номеров ГТС и местных номеров, которые будут работать у абонентов отделов и служб РДУ, расположенных по адресу: Александровское шоссе,13 в период проведения конверсии АТС Hicom 300H.\r\n     Служба ТМиС\r\n\r\n<a href="/download/changenum.doc">перечень</a>\r\n', 1, 9, 0),
(72, '2006-09-14 08:49:37', 0, '<a href="https://rdusps/Общие%20узлы/Image%20Library/Forms/AllItems.aspx?RootFolder=%2f%d0%9e%d0%b1%d1%89%d0%b8%d0%b5%20%d1%83%d0%b7%d0%bb%d1%8b%2fImage%20Library%2f%d0%a4%d0%be%d1%82%d0%be%d0%b3%d1%80%d0%b0%d1%84%d0%b8%d0%b8%20%d1%81%d0%be%d0%b1%d0%be%d1%80%d0%b0&View=%7b4B31FE0F%2d7034%2d495E%2d88E0%2dC17FF294849E%7d">Фотографии собора Ушакова</a>', 1, 7, 0),
