(74, '2006-11-13 13:15:48', 1, '             Уважаемые начальники служб и отделов!\r\n  Прошу Вас представить в АПО списки работников, желающих пройти вакцинацию от гриппа. Списки необходимы срочно, т.к. закончится срок целесообразности вакцинации.', 26, 3, 0),
(75, '2006-11-24 14:28:35', 0, 'На сайте появилась памятка для застрахованых, желающим ознакомиться жать <a href="https://rdusps/sites/ALLUSER/DocLib/Forms/AllItems.aspx">сюда</a>.', 1, 5, 0),
