(78, '2006-12-21 11:43:34', 1, 'Поздравления с Днем Энергетика можно посмотреть <a href="https://rdusps/sites/ALLUSER/DocLib/Forms/AllItems.aspx?RootFolder=%2fsites%2fALLUSER%2fDocLib%2f%d0%9f%d0%be%d0%b7%d0%b4%d1%80%d0%b0%d0%b2%d0%bb%d0%b5%d0%bd%d0%b8%d1%8f%20%d1%81%20%d0%94%d0%bd%d0%b5%d0%bc%20%d0%ad%d0%bd%d0%b5%d1%80%d0%b3%d0%b5%d1%82%d0%b8%d0%ba%d0%b0%202006&View=%7b39B44E8E%2dFF5F%2d43BF%2dB472%2d856965C791C5%7d">здесь</a>.', 1, 5, 0),
(79, '2006-12-25 08:30:30', 1, 'Фотографии с Дня Энергетика лежат на портале (<a href="https://rdusps/Общие%20узлы/Image%20Library/Forms/AllItems.aspx?RootFolder=%2f%d0%9e%d0%b1%d1%89%d0%b8%d0%b5%20%d1%83%d0%b7%d0%bb%d1%8b%2fImage%20Library%2f2006%2e12%2e22%20%d0%94%d0%b5%d0%bd%d1%8c%20%d0%ad%d0%bd%d0%b5%d1%80%d0%b3%d0%b5%d1%82%d0%b8%d0%ba%d0%b0">ссылка</a>)(<a href="file:\\\\dupakfvv\\share\\2006.12.22 День Энергетика">другая ссылка</a>).', 1, 10, 0),
(80, '2006-12-25 10:21:25', 0, 'Желающие ознакомиться с творчеством Бахметова перейдите по <a href="https://rdusps/Общие%20узлы/Image%20Library/Forms/AllItems.aspx?RootFolder=%2f%d0%9e%d0%b1%d1%89%d0%b8%d0%b5%20%d1%83%d0%b7%d0%bb%d1%8b%2fImage%20Library%2f%d0%a0%d0%b0%d0%b1%d0%be%d1%82%d1%8b%20%d0%91%d0%b0%d1%85%d0%bc%d0%b5%d1%82%d0%be%d0%b2%d0%b0&View=%7b4B31FE0F%2d7034%2d495E%2d88E0%2dC17FF294849E%7d">этой</a> ссылке.', 1, 7, 0),
(81, '2007-01-16 11:02:47', 0, ' Уважаемые специалисты, ответственные за составление    табелей рабочего времени в службах и отделах РДУ!\r\n  Прошу Вас ознакомиться с приказом Мордовского РДУ  от 12.01.2007 №3 "О балансе рабочего времени на  2007 год", размещенном на SharePoint-e.\r\n              Ведущий специалист АПО   Н.А. Павлова', 26, 20, 0),
(82, '2007-01-18 16:06:46', 0, '          Уважаемые работники Мордовского РДУ!\r\n  Обращаем ваше внимание на то, что в штате Мордовского РДУ произошли кадровые перестановки: \r\nА.И. Раужин назначен на должность Первого заместителя директора- главного диспетчера,В.Н. Бородулин назначен заместителем главного диспетчера- начальником ОДС, А.А.Липатов назначен заместителем начальника ОДС \r\nА.В. Курылев назначен на должность начальника СЭПАК, \r\nН.В. Сергеева назначена на должность главного специалиста СЭПАК, \r\nВ.В. Филимонов назначен на должность ведущего специалиста СЭПАК, \r\nП.Ю. Кондратьев назначен на должность специалиста 1 категории СЭПАК.\r\n                       Ведущий специалист АПО Н.А. Павлова', 26, 3, 0),
(83, '2007-01-19 11:04:34', 1, '             Уважаемые работники Мордовского РДУ!\r\n   Обращаем Ваше пристальное внимание на изменения в написании наименования Общества и филиалов Системного Оператора.\r\n   Сокращенное наименование ОАО "СО - ЦДУ ЕЭС" необходимо указывать в соответствии с п. 1.6 Устава Общества, а именно через тире и с пробелами.\r\n   При написании в тексте наименований филиалов слово "Филиал" указывается с заглавной буквы.\r\n   При склонении по падежам наименований филиалов Общества склоняется только слово филиал, например: "...Филиалу ОАО "СО - ЦДУ ЕЭС" Мордовское РДУ".\r\n                          Ведущий специалист АПО Н.А. Павлова', 26, 10, 0),
(84, '2007-02-07 09:51:19', 1, '<a href="https://rdusps/C2/Документы%20и%20приказы%20Мордовског/Document%20Library/Годовой%20отчет%202006%20Мордовского%20РДУ.doc">Годовой отчет Мордовского РДУ за 2006 год</a>', 1, 7, 0),
(85, '2007-03-23 13:23:52', 1, '       Уважаемые  начальники служб и отделов Мордовского РДУ!\r\n       Обращаем ваше внимание на то, что в SharePoint размещена информация о руководящем составе Мордовского филиала ТГК-6 (раздел "Документы и приказы Мордовского РДУ" папка "Входящие документы").\r\n\r\n                            Ведущий специалист АПО Павлова Н.А.', 26, 3, 0),
(86, '2007-06-08 10:10:53', 1, '   Директор Мордовского РДУ Дементьев А.М. убывает в очередной отпуск с 13 июня 2007г. по 29 июня 2007г.\r\n   Исполнение обязанностей Директора РДУ возлагаются на Главного диспетчера Раужина А.И.\r\n\r\n\r\nисп. Ярлушкина И.Ю.,33-15\r\n ', 8, 8, 0),
(87, '2007-07-02 10:16:56', 0, 'В разделе "Информация для руководящего состава" выложены документы c "Совещания по схеме развития 07-08.2007".', 1, 3, 0),
(88, '2007-07-03 16:19:25', 1, '       Вниманию начальников служб и отделов!\r\n6 июля т.г. предполагается выезд на природу в связи с 5-летием ОАО "СО-ЦДУ ЕЭС" и 4-летием РДУ. Ориентировочный вклад - 400 руб. В связи с этим прошу начальников служб т отделов до 10-00 часов 4 июля представить в отдел АХО сведения о количестве желающих принять участие. ', 26, 3, 1),
(89, '2007-07-16 15:31:47', 1, 'В разделе "Документы и приказы Мордовского РДУ" выложена информация по совещанию в Саратове.', 1, 6, 0),
(90, '2007-07-23 08:06:55', 0, 'В целях создания концепции логотипа ОАО "СО-ЦДУ ЕЭС", отражающего идеологию и основные направления деятельности ОАО "СО-ЦДУ ЕЭС", объявлен конкурс (приказ от 04.07.2007 №197). По вопросам проведения конкурса обращаться к Медведеву В.И. или Филимонову В.В.', 1, 7, 0),
(91, '2007-07-27 10:07:31', 1, 'Энергосистема обрастает мускулами (<a href="\\\\ex\\RDU_DOC\\so-47-200705.jpg">статья</a>).', 1, 7, 0);
